import "./App.css";
import React from "react";
import { BrowserRouter as Router } from "react-router-dom";
// import Sidebar from "./components/pages/Sidebar"; //for testing
import Home from "./pages";
import Particles from "react-particles-js";

function App() {
  return (
    <div style={{ position: "relative" }}>
      <div
        style={{
          position: "absolute",
          width: "100%",
          height: "100vh",
          top: "0",
          left: "0",
        }}
      >
        <Particles
          params={{
            particles: {
              number: {
                value: 100,
              },
              size: {
                value: 1,
              },
            },
            color: {
              value: "#CCC",
            },
            interactivity: {
              detect_on: "canvas",
              events: {
                onhover: { enable: true, mode: "repulse" },
                onclick: { enable: true, mode: "push" },
                resize: true,
              },
            },
          }}
        />
      </div>
      <div
        style={{
          position: "absolute",
          width: "100%",
          top: "0",
          left: "0",
        }}
      >
        <Router>
          <Home />
        </Router>
      </div>
    </div>
  );
}

export default App;
